#include "rtv1.h"

typedef struct	s_lim
{
	float	max;
	float	min;
}				t_lim;

typedef struct	s_ray
{
	float3		o;
	float3		d;
}				t_ray;

typedef struct	s_object
{
	char		type;
	float		dist;
	float3		center;
	float		radius;
	float3		norm;
	float		alpha; //cone

	int3		color;
	int			specular;
	float		reflective;
	int			texture;
	char		textype;
	float2		shift;
	float2		scale;
	float		refractive;
}				t_object;

typedef struct	s_source
{
	float3		position;
	//float		intensity;
	char		type;
	float3		intensities;
}				t_source;

typedef struct	s_params
{
	float	t1;
	float	t2;
}				t_params;

typedef struct	s_matrix
{
	float		m[3][3];
}				t_matrix;

//////////////////////////////////
typedef struct	s_vec_par
{
	t_vector	o_big;
	t_vector	p_big;
	t_vector	l_big;
	t_vector	normal;
	float		n_dot_l;
	t_vector	r_big;
	t_vector	v_big;
	float		r_dot_v;
}				t_vec_par;
///////////////////////////////

typedef struct	s_scene
{
	t_object	objects[20];
	t_source	sources[10];
	float3		startviewpoint;
	float3		viewpoint;
	t_matrix	rot_matrix;
	t_lim		cl_lim;
	t_lim		tr_lim;





	cl_float3	cam_ang;


	t_vec_par	vec_params;
}				t_scene;	

